Κιμούλης στη Ζέτα Δούκα: -Ειλικρινα συγνώμη.
Δούκα: -Γιατι τώρα;
#ΖεταΔουκα #MeToo

Οι ζαίοι υποστηρίζουν δηλ τον "σύντροφο" επειδή είναι σύντροφος αλλά ταυτοχρόνως είναι και φεμινιστές κ εναντίον της βίας κατά των γυναικών εκτός κι αν την ασκούν ομοϊδεάτες τους;
Πείτε μας ότι τα καφριλίκια του κιμούλη είναι "πολιτική πράξη"
#Κιμουλης #Ζετα_Δουκα #κουφοντινας https://t.co/AzbsyGAY7R

Σιγή ιχθύος για Ζέτα Δούκα μέρα δεύτερη.
Που είναι όλοι αυτοί και αυτές που σπαραζουν και σκίζουν τα ιμάτια τους για όλες αυτές και αυτούς που έχουν δεχτεί βία και παρενόχληση; 
Δυο μέτρα και δυο σταθμά; 
Που είναι η Έλενα Ακρίτα επιτέλους,να βάλει τα πράγματα στη θέση τους;

Τι δουλειά ειχε η Μπεκατωρου μόνη της στο δωμάτιο ενός άνδρα;
Τι δουλειά είχε η Ζετα Δούκα στο θέατρο με τον Κιμούλη;
Τι δουλειά έχουν οι γυναικες στον αθλητισμό;
Τι δουλειά έχουν οι γυναικες σε θέσεις εργασίας;

«Η Ζετα Δούκα είναι ένας άνθρωπος που δεν έχει δώσει δικαιώματα»
Μαλεσκου τι λες;για ποια δικαιώματα μιλάς;;;;
Έξω φρενών έγινα με την ηλίθια!!!#loveit

Γιατί μας κάνει εντύπωση που οι ζαίοι υποστηρίζουν Κιμούλη;;;
Εδώ υποστηρίζουν τον κατά συρροή δολοφόνο Κουφοντίνα, στον Κιμούλη θα κώλωναν για μια τόση δα κλωτσίτσα;
#Κιμουλης #Ζετα_Δουκα #κουφοντινας

Εργασιακός Εκφοβισμός, το μπούλινγκ στην δουλειά, επίσημος όρος mobbing.
